rvices/dwc/1803d72c-e9f0-4887-a300-30a3a7d76c02", "link": "http://swbiodiversity.org/seinet/collections/datasets/dwc/ASU-Seeds_DwC-A.zip", "ingest": true, "update": "2015-01-13T00:00:00", "contacts": [{"email": "seinetadmin@asu.edu"}, {"email": "fall@asu.edu", "first_name": "Patricia Fall"}], "logo_url": "http://swbiodiversity.org/seinet/images/collicons/seeds.jpg", "data_rights": "CC BY-NC-SA", "other_guids": [], "collection_name": "Arizona State University Fruit and Seed Collection", "collection_description": "", "institution_web_address": "http://collections.asu.edu/herbarium/index.html"}, "http://swbiodiversity.org/seinet/webservices/dwc/27dc3568-b638-4917-afcf-3dd7eac73cf9": {"id": "http://swbiodiversity.org/seinet/webservices/dwc/27dc3568-b638-4917-afcf-3dd7eac73cf9", "link": "http://swbiodiversity.org/seinet/collections/datasets/dwc/EIU_DwC-A.zip", "ingest": true, "update": "2015-02-25T00:00:00", "contacts": [{"email": "seinetadmin@asu.edu"}, {"email": "gctucker@eiu.edu", "first_name": "Gordon C. Tucker, Curator"}], "logo_url": "http://sernecportal.org/portal/images/collicons/eiu.jpg", "data_rights": "CC BY-NC-SA", "other_guids": [], "collection_name": "Stover-Ebinger Herbarium (Eastern Illinois University)", "collection_description": "The &lt;b&gt;Stover-Ebinger Herbarium&lt;/b&gt; has about 80,000 specimens. It contains a good representation of the flora of the midwestern United States, but most of its specimens were collected in Illinois. Students and faculty conducting ecological studies and floristic inventories use the herbarium to help identify the plants they see and collect. Students in Plant Taxonomy, Dendrology, and Wetland Plants classes use it to become familiar with species and for identification of specimens. In the Wetland Plants, General Botany, Ethnobotany, and Plant Morphology classes, herbarium specimens are used to to make morphological comparisons among relevant plant taxa. The herbarium was started in 1899. Originally named the Stover Herbarium for Dr. Ernest L. Stover, professor of botany from 1923-1960, the Botany Dept. faculty voted in 1995 to &quot;expand&quot; the name to honor John E. Ebinger on the occasion of his retirement. Dr. Ebinger collected about half the specimens in the collection and served as curator from 1963-1995. For information about vascular plants and bryophytes, contact Dr. Gordon C. Tucker (gctucker@eiu.edu); for fungi and lichens, contact Dr. Andrew S. Methven (asmethven@eiu.edu).", "institution_web_address": "http://ux1.eiu.edu/~gctucker/eiu-herbarium.htm"}, "http://swbiodiversity.org/seinet/webservices/dwc/4c70fc5b-279a-46c0-be08-7b1fd2c556a7": {"id": "http://swbiodiversity.org/seinet/webservices/dwc/4c70fc5b-279a-46c0-be08-7b1fd2c556a7", "link": "http://swbiodiversity.org/seinet/collections/datasets/dwc/ASU-Pollen_DwC-A.zip", "ingest": true, "update": "2015-01-13T00:00:00", "contacts": [{"email": "seinetadmin@asu.edu"}, {"email": "fall@asu.edu", "first_name": "Patricia Fall"}], "logo_url": "http://swbiodiversity.org/seinet/images/collicons/pollen.jpg", "data_rights": "CC BY-NC-SA", "other_guids": [], "collection_name": "Arizona State University Pollen Collection", "collection_description": "", "institution_web_address": "http://collections.asu.edu/herbarium/index.html"}, "http://swbiodiversity.org/seinet/webservices/dwc/a2e32c87-d320-4a01-bafd-a9182ae2e191": {"id": "http://swbiodiversity.org/seinet/webservices/dwc/a2e32c87-d320-4a01-bafd-a9182ae2e191", "link": "http://swbiodiversity.org/seinet/collections/datasets/dwc/ASU-Plants_DwC-A.zip", "ingest": true, "update": "2015-01-24T00:00:00", "contacts": [{"email": "seinetadmin@asu.edu"}, {"email": "wfertig@asu.edu", "first_name": "Walter Fertig"}], "logo_url": "http://swbiodiversity.org/seinet/images/collicons/asu.jpg", "data_rights": "CC BY-NC-SA", "other_guids": [], "collection_name": "Arizona State University Vascular Plant Herbarium", "collection_description": "The Arizona State University Vascular Plant Herbarium is