ction_description": "At the Louisiana State University Herbarium we study biodiversity of vascular plants, lichens, and fungi from the state of Louisiana and around the world. We maintain a permanent reference collection within these herbaria that document the historical distribution and composition of the local biodiversity, providing botanical information to researchers and the public. Our specialization is on research of native and introduced plants and fungi, their ecology and evolution.", "institution_web_address": "http://www.herbarium.lsu.edu/"}}, "auto_publish": false, "publisher_type": "symbiota"}', 'f196f6cd22ed13c9d5eb1389205c7b612d9f779b');
