erbarium for Dr. Ernest L. Stover, professor of botany from 1923-1960, the Botany Dept. faculty voted in 1995 to &quot;expand&quot; the name to honor John E. Ebinger on the occasion of his retirement. Dr. Ebinger collected about half the specimens in the collection and served as curator from 1963-1995. For information about vascular plants and bryophytes, contact Dr. Gordon C. Tucker (gctucker@eiu.edu); for fungi and lichens, contact Dr. Andrew S. Methven (asmethven@eiu.edu).", "institution_web_address": "http://ux1.eiu.edu/~gctucker/eiu-herbarium.htm"}, "http://swbiodiversity.org/seinet/webservices/dwc/4c70fc5b-279a-46c0-be08-7b1fd2c556a7": {"id": "http://swbiodiversity.org/seinet/webservices/dwc/4c70fc5b-279a-46c0-be08-7b1fd2c556a7", "link": "http://swbiodiversity.org/seinet/collections/datasets/dwc/ASU-Pollen_DwC-A.zip", "ingest": true, "update": "2015-01-13T00:00:00", "contacts": [{"email": "seinetadmin@asu.edu"}, {"email": "fall@asu.edu", "first_name": "Patricia Fall"}], "logo_url": "http://swbiodiversity.org/seinet/images/collicons/pollen.jpg", "data_rights": "CC BY-NC-SA", "other_guids": [], "collection_name": "Arizona State University Pollen Collection", "collection_description": "", "institution_web_address": "http://collections.asu.edu/herbarium/index.html"}, "http://swbiodiversity.org/seinet/webservices/dwc/a2e32c87-d320-4a01-bafd-a9182ae2e191": {"id": "http://swbiodiversity.org/seinet/webservices/dwc/a2e32c87-d320-4a01-bafd-a9182ae2e191", "link": "http://swbiodiversity.org/seinet/collections/datasets/dwc/ASU-Plants_DwC-A.zip", "ingest": true, "update": "2015-01-24T00:00:00", "contacts": [{"email": "seinetadmin@asu.edu"}, {"email": "wfertig@asu.edu", "first_name": "Walter Fertig"}], "logo_url": "http://swbiodiversity.org/seinet/images/collicons/asu.jpg", "data_rights": "CC BY-NC-SA", "other_guids": [], "collection_name": "Arizona State University Vascular Plant Herbarium", "collection_description": "The Arizona State University Vascular Plant Herbarium is