-Ebinger Herbarium (Eastern Illinois University)", "collection_description": "The &lt;b&gt;Stover-Ebinger Herbarium&lt;/b&gt; has about 80,000 specimens. It contains a good representation of the flora of the midwestern United States, but most of its specimens were collected in Illinois. Students and faculty conducting ecological studies and floristic inventories use the herbarium to help identify the plants they see and collect. Students in Plant Taxonomy, Dendrology, and Wetland Plants classes use it to become familiar with species and for identification of specimens. In the Wetland Plants, General Botany, Ethnobotany, and Plant Morphology classes, herbarium specimens are used to to make morphological comparisons among relevant plant taxa. The herbarium was started in 1899. Originally named the Stover Herbarium for Dr. Ernest L. Stover, professor of botany from 1923-1960, the Botany Dept. faculty voted in 1995 to &quot;expand&quot; the name to honor John E. Ebinger on the occasion of his retirement. Dr. Ebinger collected about half the specimens in the collection and served as curator from 1963-1995. For information about vascular plants and bryophytes, contact Dr. Gordon C. Tucker (gctucker@eiu.edu); for fungi and lichens, contact Dr. Andrew S. Methven (asmethven@eiu.edu). The &lt;b&gt;Stover-Ebinger Herbarium&lt;/b&gt; has about 80,000 specimens. It contains a good representation of the flora of the midwestern United States, but most of its specimens were collected in Illinois. Students and faculty conducting ecological studies and floristic inventories use the herbarium to help identify the plants they see and collect. Students in Plant Taxonomy, Dendrology, and Wetland Plants classes use it to become familiar with species and for identification of specimens. In the Wetland Plants, General Botany, Ethnobotany, and Plant Morphology classes, herbarium specimens are used to to make morphological comparisons among relevant plant taxa. The herbarium was started in 18